import Nav from '../PixelVenturesContainer/Home/Nav/Nav'
import Header from '../PixelVenturesContainer/Home/Header/Header'
import Tech from '../PixelVenturesContainer/Tech/Tech'
import Portfolio from '../PixelVenturesContainer/Portfolio/Portfolio'
import About from '../PixelVenturesContainer/Home/About/About'
import Contact from '../PixelVenturesContainer/Home/Contact/Contact'
import Footer from '../PixelVenturesContainer/Home/Footer/Footer'

export const TOTAL__SCREENS = [
    {
        screen_name: "Nav",
        component: Nav
    },
    {
        screen_name: "Header",
        component: Header
    },
    {
        screen_name: "Tech",
        component: Tech
    },
    {
        screen_name: "Portfolio",
        component: Portfolio
    },
    {
        screen_name: "About",
        component: About
    },
    {
        screen_name: "Contact",
        component: Contact
    },
    {
        screen_name: "Footer",
        component: Footer
    }
]

export const GET_SCREEN_INDEX = (screen_name) => {
    if(!screen_name) return -1;

    for(let i = 0; i < TOTAL__SCREENS.length; i++) {
        if(TOTAL__SCREENS[i].screen_name === screen_name) return i;
    }
    return -1;
}
